const Description = styled.div``;
const DescriptionContentBlockDetail = () => (
  <Container>
    <DescriptionSmall>HI</DescriptionSmall>
    <CatchPhrase></CatchPhrase>
  </Container>
);

export default DescriptionContentBlockDetail;
